import "./styles.css";
import { ReactComponent as Logo } from "./logo.svg";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="main-navbar">
      <Logo />
      <Link to="/" className="logo-text">
        DS Delivery
      </Link>
      <div>
        <Link to="#" className="entrar">
          <b>Entrar</b>
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
